import './App.css';
import { Canvas } from "@react-three/fiber";
import { Suspense } from "react";
import { CosmosapiensNFT} from "./components/CosmosapiensNFT/CosmosapiensNFT";

function App() {

  return (
    <div className='screen'>
      <div className='darkBg'>
        <CosmosapiensNFT />
        <Canvas>
          <Suspense fallback={null}>
          </Suspense>
        </Canvas>
      </div>
    </div>
  );
}

export default App;
